import React, { useState, useContext } from "react";
// import Box from "@material-ui/core/Box";
import Button from "@material-ui/core/Button";
import Container from "@material-ui/core/Container";
import Grid from "@material-ui/core/Grid";
import TextField from "@material-ui/core/TextField";
import FormGroup from "@material-ui/core/FormGroup";
import Card from "@material-ui/core/Card";
import Link from "@material-ui/core/Link";
import { makeStyles } from "@material-ui/core/styles";
// import Axios from "axios";
// import { SessionContext, setSessionCookie } from "../components/UserContext";
// import { useHistory } from "react-router";

function Login() {
  var UserisRegistered = false;
  const [isRegistered, setRegisterState] = useState(true);
  const [UserName, setUserName] = useState("");
  const [password, setPassword] = useState("");
  // const history = useHistory();
  // const { setSession } = useContext(SessionContext);
  function handleClicked(){
    setRegisterState(!isRegistered);
  }
  return (

    <div className="root">
    <Form>
  <Form.Group className="mb-3" controlId="formBasicEmail">
    <Form.Label>Email address</Form.Label>
    <Form.Control type="email" placeholder="Enter email" />
    <Form.Text className="text-muted">
      We'll never share your email with anyone else.
    </Form.Text>
  </Form.Group>

  <Form.Group className="mb-3" controlId="formBasicPassword">
    <Form.Label>Password</Form.Label>
    <Form.Control type="password" placeholder="Password" />
  </Form.Group>
  <Form.Group className="mb-3" controlId="formBasicCheckbox">
    <Form.Check type="checkbox" label="Check me out" />
  </Form.Group>
  <Button variant="primary" type="submit">
    Submit
  </Button>
</Form>
      <Card className="card">
        <Container className='loginSquare' maxWidth="xs">
          {/* <form
            onSubmit={(e) => {
              signUp(e);
            }}
          > */}
            <FormGroup>
              <h1 className="title">
                {isRegistered ? "Log in" : "Register"}
              </h1>
              {/* {!isRegistered ? (
                <div>
                  <Grid item xs={12}>
                    <TextField
                      fullWidth
                      type="text"
                      id="firstname"
                      placeholder="First Name"
                      required
                      autofocus
                    >
                      {" "}
                    </TextField>
                  </Grid>
                  <Grid item xs={12}>
                    <TextField
                      fullWidth
                      type="text"
                      id="lastname"
                      placeholder="Last Name"
                      required
                      autofocus
                    >
                      {" "}
                    </TextField>
                  </Grid>
                </div>
              ) : null} */}
              <Grid item xs={12}>
                <TextField
                  fullWidth
                  type="text"
                  id="username"
                  placeholder="Email"
                  name="username"
                  label="Email"
                  required
                  autofocus
                ></TextField>
              </Grid>
              <Grid item xs={12}>
                <TextField
                  fullWidth
                  label="Password"
                  name="password"
                  size="small"
                  type="password"
                  id="password"
                />
              </Grid>
              <Grid item xs={12}>
                <Button
                  className={Button}
                  color="primary"
                  variant="outlined"
                  fullWidth
                  type="submit"
                >
                  {isRegistered ? "Login" : "Register"}
                </Button>
              </Grid>
              <Grid item xs={12}>
                <div className="link">
                  <Link onClick={handleClicked}>
                    {isRegistered ? "Register" : "Login"}
                  </Link>
                </div>
              </Grid>
            </FormGroup>
          {/* </form> */}
        </Container>
      </Card>
    </div>
  );
}
export default Login;
